import React from "react";
import extracy from "./extracy_logo.png";
import { Grid } from "semantic-ui-react";

const RightPanel = () => {
  return (
    <div>
      <Grid>
        <img
          src={extracy}
          alt=""
          style={{
            position: "relative",
            top: "20vh",
            left: "6vw",
            width: "55vw",
          }}
        ></img>

        <Grid.Row
          style={{
            top: "45vh",
            left: "7vw",
          }}
        >
          <Grid columns={3}>
            <Grid.Row>
              <Grid.Column>
                <Grid.Row padded={true}>Wubba</Grid.Row>
                <Grid.Row>Wubba</Grid.Row>
                <Grid.Row>Wubba</Grid.Row>
                <Grid.Row>Wubba</Grid.Row>
              </Grid.Column>
              <Grid.Column>Lubba</Grid.Column>
              <Grid.Column>Lubba</Grid.Column>
              <Grid.Column>Lubba</Grid.Column>
            </Grid.Row>
          </Grid>
        </Grid.Row>
      </Grid>
    </div>
  );
};

export default RightPanel;
